import React from "react";

export default function NumberCell({ value, row, col, onClick, isSelected }) {
  const handleClick = () => {
    if (value !== null && onClick) {
      onClick(row, col);
    }
  };

  return (
    <td 
      onClick={handleClick}
      className={isSelected ? "selected" : ""}
    >
      {value !== null ? value : ""}
    </td>
  );
}
